import React from 'react'
import './Movies.css'

const MovieCard =  (props) => {
    return (
        <div className='movie-info'>
            <div className="buttons">
                <h3 style={{width:'100px', overflow: 'hidden', textOverflow: 'ellipsis', whiteSpace: 'nowrap'}}>{props.title}</h3>
                <img src = {props.image}/>
           </div>

        </div>  
    )
}

export default MovieCard
